        closest_dist = None
        for elem2 in unique_elems:
            dist = abs(elem - elem2)
            if closest_dist is None or dist < closest_dist:
                closest_dist = dist
                closest_elem = elem2

        if closest_dist <= threshold:
            return True

    return False

