def separate_paren_groups(paren_string: str) -> List[str]:
    stack: List[int] = []
    result: List[str] = []

    for char in paren_string:
        if char == "(":
            stack.append(char)
        elif char == ")":
            if len(stack) > 0:
                stack.pop()
            else:
                result.append("".join(stack))
                stack.clear()

    if len(stack) > 0:
        raise ValueError("Unbalanced parentheses")

    return result

