def next_smallest(lst):
    if len(lst) < 3:
        return None
    min_heap = []
    for i in range(len(lst)):
        heapq.heappush(min_heap, (lst[i], i))
    _, idx = heapq.heappop(min_heap)
    return lst[idx + 1]

